      function drawPath($map, $key, $fill, $info = '') {
          if (!is_array($map)) {
              echo '<path class="enabledPath" id="' . $key . '" info="' . $info . '" fill="' . $fill . '" stroke="#FFFFFF" stroke-width="2" d="' . $map . '"/>';
          } else {
              echo '<g>';
              foreach ($map as $value) {
                  echo '<path class="enabledPath" id="' . $key . '" info="' . $info . '" fill="' . $fill . '" stroke="#FFFFFF" stroke-width="2" d="' . $value . '"/>';
              }
              echo '</g>';
          }
      }

      $mapData = $this->mapData;

      foreach ($mapArr as $key => $map) {
          if (array_key_exists($key, $mapData)) {
              drawPath($map, $key, $mapData[$key]['color'], $mapData[$key]['name'] . ': ' . $mapData[$key]['count']);
          } else {
              drawPath($map, $key, '#5abbf7');
          }
      }
